css:
.git-menu .file-tree {
  width: 100%;
  line-height: 1.4em;
  margin-bottom: 15px;
}
.git-menu .file-tree .buttons button {
  border: 0;
  text-decoration: underline;
  background-color: transparent;
  font-size: .9em;
  margin-bottom: 5px;
}
.git-menu .file-tree .files {
  padding: 2px;
  max-height: 14em;
  overflow: auto;
}
.git-menu .file-tree .files ul {
  padding-left: 0px;
  margin-bottom: 0px;
}
.git-menu .file-tree .files ul ul {
  padding-left: 20px;
  margin-top: 10px;
}
.git-menu .file-tree .files ul li {
  list-style: none;
  margin-bottom: 10px;
}
.git-menu .file-tree .files ul li:last-child {
  margin-bottom: 0px;
}
.git-menu .file-tree .files ul li.untracked,
.git-menu .file-tree .files ul li.added {
  color: #73c990;
}
.git-menu .file-tree .files ul li.changed {
  color: #e2c08d;
}
.git-menu .file-tree .files ul li.deleted {
  color: #ff6347;
}
.git-menu .file-tree .files ul li.unchecked {
  color: rgba(158, 161, 179, 0.6);
}
.git-menu .file-tree .files ul li.dir {
  cursor: default;
}
.git-menu .file-tree .files ul li.collapsed ul {
  display: none;
}
